    return (
        <div className="captain-picks-container">
            <div id="captain-picks-general-title">
                <h2>Top three captain picks for GW1</h2>
            </div>
            <div id="captain-picks-general-picks-container">

            </div>
        </div>
    )
}

function CaptainPick( props ) {
